UPDATE NRM FROM $$FINLGLVWDB.MT_INV_REV_MEASURE NRM, $$STGDB.WI_INV_REV_MEASURE_SMR_POS WRM SET END_CUSTOMER_KEY = (CASE WHEN WRM.END_CUSTOMER_KEY=-999 THEN RANDOM(1000000,1001800)*-1 ELSE WRM.END_CUSTOMER_KEY END), EDW_UPDATE_USER = USER, EDW_UPDATE_DATETIME = CURRENT_TIMESTAMP(0) WHERE WRM.REVENUE_MEASURE_KEY = NRM.REVENUE_MEASURE_KEY AND WRM.REV_MEASURE_TRANS_TYPE_CD = NRM.REV_MEASURE_TRANS_TYPE_CD AND WRM.DV_FISCAL_YEAR_MTH_NUMBER_INT = NRM.DV_FISCAL_YEAR_MTH_NUMBER_INT AND NRM.REV_MEASURE_TRANS_TYPE_CD IN ('POS') AND (CASE WHEN NRM.END_CUSTOMER_KEY BETWEEN -1001800 AND -1000000 THEN -999 ELSE NRM.END_CUSTOMER_KEY END) <> WRM.END_CUSTOMER_KEY;
UPDATE GL from $$FINLGLVWDB.MT_INV_REV_MEASURE GL , $$STGDB.WI_INV_REV_MEASURE_SMR_POS W_GL
SET DV_2T_DISTI_REVENUE_FLG = 'Y', EDW_UPDATE_DATETIME=CURRENT_TIMESTAMP(0)
WHERE GL.DD_BK_DIRECT_CORP_ADJ_TYPE_CD = 'POS ALLOCATION' AND GL.DV_FISCAL_YEAR_MTH_NUMBER_INT IN (SELECT FISCAL_ID FROM $$ETLVWDB.EL_AR_MONTH_PROCESS_DATE) AND W_GL.DV_FISCAL_YEAR_MTH_NUMBER_INT = GL.DV_FISCAL_YEAR_MTH_NUMBER_INT AND W_GL.REVENUE_MEASURE_KEY = GL.REVENUE_MEASURE_KEY AND W_GL.REV_MEASURE_TRANS_TYPE_CD = GL.REV_MEASURE_TRANS_TYPE_CD ;
UPDATE NRM FROM $$FINLGLVWDB.MT_INV_REV_MEASURE NRM, $$STGDB.WI_INV_REV_MEASURE_SMR_POS WRM SET XCAT_FLG=WRM.XCAT_FLG, RECURRING_OFFER_FLG = WRM.RECURRING_OFFER_FLG, BK_OFFER_TYPE_NAME =WRM.BK_OFFER_TYPE_NAME, ELA_FLG = WRM.ELA_FLG, EDW_UPDATE_USER = USER, EDW_UPDATE_DATETIME = CURRENT_TIMESTAMP(0) WHERE WRM.REVENUE_MEASURE_KEY = NRM.REVENUE_MEASURE_KEY AND WRM.REV_MEASURE_TRANS_TYPE_CD = NRM.REV_MEASURE_TRANS_TYPE_CD AND WRM.DV_FISCAL_YEAR_MTH_NUMBER_INT = NRM.DV_FISCAL_YEAR_MTH_NUMBER_INT AND NRM.REV_MEASURE_TRANS_TYPE_CD IN ('POS') AND( NRM.XCAT_FLG <> WRM.XCAT_FLG OR NRM.BK_OFFER_TYPE_NAME <> WRM.BK_OFFER_TYPE_NAME OR NRM.RECURRING_OFFER_FLG <> WRM.RECURRING_OFFER_FLG OR NRM.ELA_FLG <> WRM.ELA_FLG );
UPDATE GL FROM $$FINLGLVWDB.MT_INV_REV_MEASURE GL, $$COMREFVWDB.N_PRODUCT_TV NP SET DV_PRODUCT_SUBSCRIPTION_FLG = 'Y' WHERE GL.PRODUCT_KEY = NP.ITEM_KEY AND NP.ACCOUNTING_ELEMENT_CD = 'PRODUCT-SUBSCRIPTION' AND GL.DV_FISCAL_YEAR_MTH_NUMBER_INT IN(SELECT FISCAL_ID FROM $$ETLVWDB.EL_AR_MONTH_PROCESS_DATE) AND NP.END_TV_DATE = '3500-01-01' AND GL.REV_MEASURE_TRANS_TYPE_CD = 'POS';
INSERT INTO $$STGDB.WI_INV_REV_MSR_IND_DEL_SMR SELECT MDSPD.ALLOCATED_POS_ADJ_KEY AS REVENUE_MEASURE_KEY , MDSPD.PROCESS_DT AS PROCESS_DATE , 'POS' AS REV_MEASURE_TRANS_TYPE_CD, MDSPD.EDW_UPDATE_DTM FROM $$SLSORDVWDB.MT_DRVD_SCA_POS_ADJ_DTL_DEL_NG MDSPD WHERE MDSPD.EDW_UPDATE_DTM > (SELECT LAST_EXTRACT_DATE FROM $$ETLVWDB.CTL_ETL_LAST_EXTRACT_DATES WHERE JOB_STREAM_ID='wf_MT_INV_REV_MEASURE_POS' AND TABLE_NAME='MT_DRVD_SCA_POS_ADJ_DTL_DEL_NG') ;
COLLECT STATS ON $$STGDB.WI_INV_REV_MSR_IND_DEL_SMR ;
DELETE NBM FROM $$FINLGLVWDB.MT_INV_REV_MEASURE NBM, $$STGDB.WI_INV_REV_MSR_IND_DEL_SMR WBM WHERE NBM.REVENUE_MEASURE_KEY = WBM.REVENUE_MEASURE_KEY AND NBM.REV_MEASURE_TRANS_TYPE_CD= WBM.REV_MEASURE_TRANS_TYPE_CD AND NBM.REV_MEASURE_TRANS_TYPE_CD IN ('POS');
UPDATE CTL FROM $$ETLVWDB.CTL_ETL_LAST_EXTRACT_DATES CTL , ( SEL MAX(EDW_UPDATE_DATETIME) AS EDW_UPDATE_DATETIME FROM $$STGDB.WI_INV_REV_MSR_IND_DEL_SMR WHERE REV_MEASURE_TRANS_TYPE_CD = 'POS' ) WI SET LAST_EXTRACT_DATE= COALESCE(WI.EDW_UPDATE_DATETIME,CTL.LAST_EXTRACT_DATE) WHERE JOB_STREAM_ID = 'wf_MT_INV_REV_MEASURE_POS' AND TABLE_NAME='MT_DRVD_SCA_POS_ADJ_DTL_DEL_NG';
